      Totaled! is a fast-paced, furious and fun step into the world of
      classic cars and their subsequent destruction. Climb into a hot red, 
      muscle or performance car and rip it apart at the expense of your  
      opponents. No engine tweaking, tire balancing or pit stops, just 
      glorious mayhem in the cars of your dreams.

